class PoDLE {

    static func generatePodle(priv: BigInt, u: String, index: Int = 0) -> [String: String] {

        let baseGen = secp256k1()
        let k: BigInt = BigInt(BigUInt.randomInteger(withExactWidth: 256))
    
        //// kG
        var kG = baseGen.publicKey(priv: k).serialize()
        kG = kG.dropFirst(max(0, kG.count - 33)) // to remove additional zeros from start

        //// P = xG
        var P = baseGen.publicKey(priv: priv).serialize()
        P = P.dropFirst(max(0, P.count - 33))

        //// J = getNUMS(index)  // alternative base point
        let J = getNUMS(index: index)
        let altGen = secp256k1(Point(J["x"]!, J["y"]!))

        //// kJ
        var kJ = altGen.publicKey(priv: k).serialize()
        kJ = kJ.dropFirst(max(0, kJ.count - 33))

        //// P2 = xJ (x is priv)
        var P2 = altGen.publicKey(priv: priv).serialize()
        P2 = P2.dropFirst(max(0, P2.count - 33))

        //// H(P2) is commitment
        var d1 = Data.init(count: 33)
        d1.replaceSubrange((33 - P2.count)...32, with: P2)
        let commit = SHA256.hash(data: d1)

        // Schnorr 
        // e = H(kG + kJ + P + P2)
        // s = k + x*e
        var d2 = Data.init(count: 132)
        d2.replaceSubrange((132 - P2.count)...131, with: P2)
        d2.replaceSubrange((99 - P.count)...98, with: P)
        d2.replaceSubrange((66 - kJ.count)...65, with: kJ)
        d2.replaceSubrange((33 - kG.count)...32, with: kG)
        let e = SHA256.hash(data: d2)
        let e_value = BigInt.init(e.map{String(format:"%02x",$0)}.joined(), radix: 16)!

        let s = (k + (priv * e_value)%secp256k1.N)%secp256k1.N

        return ["utxo": u,
                "P": P.map{String(format:"%02x",$0)}.joined(), 
                "P2": P2.map{String(format:"%02x",$0)}.joined(), 
                "commit": commit.map{String(format:"%02x",$0)}.joined(), 
                "sig": String(s), 
                "e": e.map{String(format:"%02x",$0)}.joined()]
    }

